import React, { Component } from 'react';
import {Button, FormGroup, FormControl, ControlLabel, Grid, Row, Col, Tooltip, OverlayTrigger} from 'react-bootstrap';
import './dashboard.css';
import Label from './../../components/Label.js';
import {Animated} from "react-animated-css";
import Iframe from 'react-iframe';

class Dashboard extends Component {
  constructor(props) {
    super(props);
    this.state = {greetingText:'Hi Admin, Good Morning - You were last logged in at 10 AM 21-11-2018'};

    this.onLogoutClick = this.onLogoutClick.bind(this);
  }

  onLogoutClick(event)
  {
    if(event.target.name == "report")
    {
      console.log('report');
    }
    else if(event.target.name == "config")
    {
      console.log('config');
    }
    else if(event.target.name == "logout")
    {
      this.props.history.push('/');
    }
  }


  render() {
    const logout = (
        <Tooltip id="tooltip">
          Logout
        </Tooltip>
      );

      const report = (
          <Tooltip id="tooltip">
            Report And Analytics
          </Tooltip>
        );

    const config = (
            <Tooltip id="tooltip">
              Configuration
            </Tooltip>
          );

    return (
        <div className="dashboard">
          <div className="menuHeader">
            <div className="userInfo">
              <Label text={this.state.greetingText}/>
            </div>
            <div>
              <OverlayTrigger placement="left" overlay={report}>
                <img src={require('./../../resources/images/report.png')} name="report" className="logoutBtn" onClick={this.onLogoutClick}/>
              </OverlayTrigger>
            </div>

            <div>
              <OverlayTrigger placement="left" overlay={config}>
                <img src={require('./../../resources/images/settings.png')} name="config" className="logoutBtn" onClick={this.onLogoutClick}/>
              </OverlayTrigger>
            </div>

            <div>
              <OverlayTrigger placement="left" overlay={logout}>
                <img src={require('./../../resources/images/logout.png')} className="logoutBtn" name="logout" onClick={this.onLogoutClick}/>
              </OverlayTrigger>
            </div>

          </div>

          <div className="kibana">
          <Iframe url="https://demo.elastic.co"
            width="100%"
            height="100%"
            id="myId"
            className="kibanaDashboard"
            display="initial"
            position="relative"
            allowFullScreen/>
          </div>
        </div>
    );
  }
}

export default Dashboard;
